INSERT INTO `author_articles` VALUES (4,'published','<h1 style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 56px; line-height: 1; font-family: &quot;Montserrat Bold&quot;, montserrat-bold, Montserrat, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: -3px; padding: 0px; color: rgba(0, 0, 0, 0.8); overflow-wrap: break-word; letter-spacing: -0.04em;\"><span style=\"background-color: rgb(255, 156, 0);\">Naruto: The Unresolved Revolution</span></h1><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 56px; line-height: 1; font-family: &quot;Montserrat Bold&quot;, montserrat-bold, Montserrat, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: -3px; padding: 0px; color: rgba(0, 0, 0, 0.8); overflow-wrap: break-word; letter-spacing: -0.04em;\"><br></p><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 22px; line-height: 1.5; font-family: tartbook-book, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; letter-spacing: 0.01rem; color: rgba(0, 0, 0, 0.8);\"><em style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">This article contains spoilers for the Naruto Shippuden manga.&nbsp;</span></em></p><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 22px; line-height: 1.5; font-family: tartbook-book, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; letter-spacing: 0.01rem; color: rgba(0, 0, 0, 0.8);\"><em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">Naruto&nbsp;</em>begins quite innocently — it’s about the titular character who wants to be the strongest ninja in the village, the&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">Hokage</em>. His dream is fueled by his desire to be acknowledged by the people in the village who shunned him for having a monster sealed inside him. It follows the typical&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">shonen</em>&nbsp;underdog trope, in which the weakest character grows to become the strongest and most respected of them all. As the series progresses and Naruto learns more and more about the troubled<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">&nbsp;shinobi</em>&nbsp;world around him, he makes repeated promises to those he meets that he will become Hokage and change the system. The series, in its discourse between oppressed groups of people, is full of politics.</p><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 22px; line-height: 1.5; font-family: tartbook-book, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; letter-spacing: 0.01rem; color: rgba(0, 0, 0, 0.8);\">Masashi Kishimoto, the author of the series, ineloquently drops all political issues&nbsp;come the final chapters of&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">Naruto Shippuden.&nbsp;</em>Indeed, in the end, Naruto becomes&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">Hokage</em>&nbsp;and is gifted with godlike powers. There is peace in the ninja world. But what did Naruto change about the&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">shinobi</em>&nbsp;system? Fans who have had years to examine the questions the series addresses are greatly disappointed in Kishimoto’s subpar handling in the final chapters. Kishimoto followed the anti-establishment tropes prevalent in many&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">shonen</em>&nbsp;anime, but failed to follow through, instead telling a story about lawful endurance.</p><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 22px; line-height: 1.5; font-family: tartbook-book, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; letter-spacing: 0.01rem; color: rgba(0, 0, 0, 0.8);\"><br></p><h2 style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 36px; font-family: &quot;Montserrat Bold&quot;, montserrat-bold, Montserrat, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: -1.8px; padding: 0px; overflow-wrap: break-word; letter-spacing: -0.02em;\"><font color=\"#ff9c00\">The Demonized Clans</font></h2><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 22px; line-height: 1.5; font-family: tartbook-book, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; letter-spacing: 0.01rem; color: rgba(0, 0, 0, 0.8);\">Much of the latter half of&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">Naruto Shippuden&nbsp;</em>is dedicated to the age-old grudge between the Senju and the Uchiha. Hashirama and Madara’s battles end in a peace treaty, forming The Hidden Village of the Leaves. For generations after that, however, the Senju maintained power while the Uchiha’s power diminished. Madara, one of the main antagonists of the series, notices his clan’s suppression and fights back against it. His powerful dissenting voice worsened the Uchiha’s status amongst the Senju, and by extension, the entire village, until the Uchiha are left quarantined into their own section, their powers delegated&nbsp;to policing the non-<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">shinobi.</em></p><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 22px; line-height: 1.5; font-family: tartbook-book, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; letter-spacing: 0.01rem; color: rgba(0, 0, 0, 0.8);\">This sequence of paranoia of minority groups, of fear of otherness, is relevant in today’s real world society. It truly is no wonder that, when Sasuke first learns the truth from Tobi after Itachi’s death, he is filled with anger towards the Leaf Village and plans to overthrow the entire shinobi system by killing all the leaders, the&nbsp;<em class=\"tle\" style=\"box-sizing: inherit; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px;\">Kages</em>. For irrational reasons, reasons tracing back to the bloody clan age, the people of the village have always distrusted the Uchiha. They feared that the powers of the Sharingan would be used to summon the Nine-tailed Fox&nbsp;to wreak havoc upon the village. In simpler terms, the village feared them because of their “otherness,” because of a conspiracy theory.</p><p style=\"box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 22px; line-height: 1.5; font-family: tartbook-book, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; vertical-align: baseline; margin-right: 0px; margin-bottom: 30px; margin-left: 0px; padding: 0px; letter-spacing: 0.01rem; color: rgba(0, 0, 0, 0.8);\"><br></p>',_binary '','2020-10-15 14:43:38','Anime, Naruto','Naruto: The Unresolved Revolution',33),(5,'published','<p><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">The confirmed return of the&nbsp;</span><a href=\"https://screenrant.com/tag/bleach/\" style=\"box-sizing: inherit; color: rgb(16, 16, 16); outline: none; padding: 0px; border-radius: 0px; border-top: none; border-right: none; border-bottom: 1px solid rgb(219, 164, 51); border-left: none; border-image: initial; transition-timing-function: ease; font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><strong style=\"box-sizing: inherit;\"><em style=\"box-sizing: inherit;\">Bleach</em></strong></a><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;anime gives a chance to finally tell the&nbsp;</span><a href=\"https://screenrant.com/bleach-anime-final-season-thousand-year-blood-war/\" style=\"box-sizing: inherit; color: rgb(16, 16, 16); outline: none; padding: 0px; border-radius: 0px; border-top: none; border-right: none; border-bottom: 1px solid rgb(219, 164, 51); border-left: none; border-image: initial; transition-timing-function: ease; font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Thousand-Year Blood War</a><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;story properly. Once upon a time,&nbsp;</span><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;was considered one of the big&nbsp;3 anime franchises alongside&nbsp;</span><a href=\"https://screenrant.com/tag/naruto/\" style=\"box-sizing: inherit; color: rgb(16, 16, 16); outline: none; padding: 0px; border-radius: 0px; border-top: none; border-right: none; border-bottom: 1px solid rgb(219, 164, 51); border-left: none; border-image: initial; transition-timing-function: ease; font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><em style=\"box-sizing: inherit;\">Naruto</em></a><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;and&nbsp;</span><a href=\"https://screenrant.com/tag/one-piece/\" style=\"box-sizing: inherit; color: rgb(16, 16, 16); outline: none; padding: 0px; border-radius: 0px; border-top: none; border-right: none; border-bottom: 1px solid rgb(219, 164, 51); border-left: none; border-image: initial; transition-timing-function: ease; font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><em style=\"box-sizing: inherit;\">One Piece</em></a><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">, and was a popular property both in Japan and internationally. The story of Ichigo Kurosaki, a seemingly regular high school student with the ability to see ghosts, captivated fans as Ichigo grew into a powerful soul reaper and unraveled the truth of both his heritage and the world around him. Due to dipping popularity,&nbsp;</span><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">\'s anime series was cancelled in 2012 and ended with the Fullbringer arc, but the manga continued&nbsp;with the Thousand-Year Blood War, which was the true conclusion to the story.</span></p><p><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><br></span></p><p><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;has retained a solid following since ending and very few subsequent&nbsp;franchises have succeeded in generating the same levels of crossover success. As such, to celebrate&nbsp;</span><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">\'s 20th anniversary, it was announced that the Thousand-Year Blood War would finally be animated. While this decision generated plenty of excitement among fans, the finale of the&nbsp;</span><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;manga isn\'t without flaws. The manga\'s version of the Thousand-Year Blood War story feels incredibly rushed at points, and there\'s a clear sense that author,&nbsp;</span><a href=\"https://screenrant.com/bleach-anime-thousand-year-blood-war-tite-kubo-response/\" style=\"box-sizing: inherit; color: rgb(16, 16, 16); outline: none; padding: 0px; border-radius: 0px; border-top: none; border-right: none; border-bottom: 1px solid rgb(219, 164, 51); border-left: none; border-image: initial; transition-timing-function: ease; font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Tite Kubo</a><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">, was being hurried to bring&nbsp;</span><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;to a close. Fights are curtailed, plot points are left unsolved and seemingly important characters are built up, only to have a minimal role. Kubo himself has even admitted that&nbsp;</span><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;didn\'t quite&nbsp;finish as he would\'ve liked.</span></p><p><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><br></span></p><p><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">The unsatisfying closing chapters were immensely frustrating, as the Thousand-Year Blood War promises much and is packed with great ideas,&nbsp;but time restraints prove to be a massive drawback. Fortunately, the returning&nbsp;</span><a href=\"https://screenrant.com/bleach-facts-trivia/\" style=\"box-sizing: inherit; color: rgb(16, 16, 16); outline: none; padding: 0px; border-radius: 0px; border-top: none; border-right: none; border-bottom: 1px solid rgb(219, 164, 51); border-left: none; border-image: initial; transition-timing-function: ease; font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><em style=\"box-sizing: inherit;\">Bleach</em>&nbsp;anime</a><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;will not have the same problem.&nbsp;</span><em style=\"box-sizing: inherit; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">Bleach</em><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\">&nbsp;is notorious for adding filler, and the Thousand-Year Blood War offers plenty of opportunity for expanding on the manga\'s story with fresh material. Moreover, the manga was on a strict time limit in the&nbsp;wake of low readership towards the end, but this is another problem the anime can avoid, since the return is only happening due to high fan demand.</span><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><br></span><span style=\"color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-size: 18px;\"><br></span></p><h6 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3.5rem; margin-left: 0px; padding: 0px; font-size: 1.8em; color: rgb(46, 44, 43); font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; line-height: 1.7;\"><h6 style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3.5rem; margin-left: 0px; padding: 0px; font-size: 1.8em; line-height: 1.7;\"><br></h6></h6>',_binary '','2020-10-15 14:54:23','Anime, Bleach','Bleach\'s Anime Return Can Fix The Final Arc\'s Problems',33);
INSERT INTO `author_articles` VALUES (6,'published','<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3.5rem; margin-left: 0px; padding: 0px; line-height: 1.7;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">﻿When Marvel Television was shut down and the production of Marvel TV series was shifted over to Kevin Feige’s Marvel Studios, just one live-action series was left behind, the horror-influenced Helstrom, based on the Marvel Comics character of Daimon Hellstrom (note the dropping of one L for the TV version). Helstrom seems to have been completed largely out of contractual obligation, and it debuts on Hulu with all of its Marvel branding stripped away. There’s no Marvel logo to open each episode, and there’s no possessive Marvel’s in the title as there has been for every other Marvel Television series.</span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3.5rem; margin-left: 0px; padding: 0px; line-height: 1.7;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">The show itself also bears essentially no connection to the Marvel Cinematic Universe, either Feige’s version or the somewhat separate version overseen by former Marvel Television boss Jeph Loeb. Aside from a Roxxon sign in the background of one scene, there’s nothing in the five episodes available for review that connects Helstrom to any other Marvel screen properties, and the show’s characters also bear little resemblance to their comic book counterparts. Created by longtime Marvel’s Agents of S.H.I.E.L.D. writer and producer Paul Zbyszewski (who also co-created the unaired Marvel’s Most Wanted), Helstrom is a generic, dull supernatural drama with a few names that may sound familiar to dedicated comics fans.</span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3.5rem; margin-left: 0px; padding: 0px; line-height: 1.7;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">The main name, of course, is Helstrom, which refers here not only to Daimon (Tom Austen) but also to his sister Ana (Sydney Lemmon), their mother Victoria (Elizabeth Marvel) and their unnamed father, who is initially labeled a serial killer but soon revealed to be something more otherworldly than that. In the comics, Daimon and Ana (aka Satana, which is a much cooler name) are the children of the devil, or at least the children of one of the many rulers of Marvel’s various versions of Hell. Here, their father seems to be a demon of some sort who spent their childhood capturing and murdering innocent people, often forcing Ana to witness or participate.</span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3.5rem; margin-left: 0px; padding: 0px; line-height: 1.7;\"><img src=\"https://static3.cbrimages.com/wordpress/wp-content/uploads/2020/09/Victoria-Helstrom-in-Her-Inmate-Uniform.jpg?q=50&amp;fit=crop&amp;w=740&amp;h=370&amp;dpr=1.5\" style=\"float: left;\" class=\"note-float-left\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\"><br></span></p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 3.5rem; margin-left: 0px; padding: 0px; line-height: 1.7;\"><br><br></p>',_binary '','2020-10-15 15:03:43','Hulu, TvSeries, Helstorm, Marvel','Helstrom Is an Anticlimactic End To a Marvel Television Era',32);
INSERT INTO `author_articles` VALUES (8,'published','<p>Amazon\'s The Boys likes to keep things mysterious when it comes to the titular team\'s gruff leader, William \"Billy\" Butcher. Volatile and merciless, Billy Butcher is a vengeful vigilante obsessed with killing superheroes who he views as less than human, but at his core, Billy is very much a tragic character. During the course of Season 1, part of his backstory is revealed, including the reason for his rage against those like Homelander. His true origin, however, remained a mystery until the release of Season 2, Episode 7, which finally mentioned his childhood and younger brother Lenny in further detail.</p><p><br></p><p>Lenny Butcher is already dead prior to the start of The Boys Season 1. He\'s revealed to have committed suicide, an act that deeply wounded Billy, causing him to blame their abusive father, Sam Butcher, and cut off all ties from the man. In the aforementioned episode, father and son are reunited when Billy seeks refuge at his Aunt Judy\'s house. Despite her promise of Sam not being there, his father is waiting for him upon arrival. He reveals that he has cancer and wants to make peace with Billy before he dies, but it\'s a failed attempt that quickly escalates into violence. No amount of apologies will ever let Billy, who loved and was very protective of his little brother, forgive Sam for driving him to suicide.</p><p><img src=\"https://static3.cbrimages.com/wordpress/wp-content/uploads/2020/07/the-boys-novel-header.jpg?q=50&amp;fit=crop&amp;w=740&amp;h=370&amp;dpr=1.5\" style=\"width: 740px;\"><br></p><p>What happens in the show, however, isn\'t quite how it happens in the comics. In the Garth Ennis and Darick Robertson\'s original series, Lenny is indeed the younger brother of Billy Butcher and does die in the story, but not from suicide. Their dynamic remains pretty much the same, if not diluted a bit to focus more on the father. In the comics, Billy is shown to take after their father while Lenny resembles their mother. He is possibly the only person in Billy\'s life aside from Becky, who could calm his brother and soothe some of his violent tendencies.</p><p><br></p><p>When the two got older, Billy joined the Royal Marines and Lenny goes off to college. This is where the TV show changes things for the plot\'s sake. Rather than commit suicide and let his father\'s abuse consume him, Lenny gets hit by a bus and dies that way. While death is sad in any form, a person\'s suicide can affect their family members quite differently, so it makes sense why the show would change this to feed Billy\'s rage.</p>',_binary '','2020-10-15 15:32:02','The Boys, Amazon','The Boys: Here\'s What Happened to Billy Butcher\'s Brother, Lenny, in the Comics',31),(9,'published','<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 18px; font-stretch: normal; line-height: 1.5em; color: rgb(49, 49, 49); font-family: &quot;Noto Serif&quot;, serif; word-break: break-word;\">A financial scam, a fraudster’s rise and fall, an ambition that became the ultimate fall — call Scam 1992 by any of these, but it is a fascinating journey set in the world of stock market. Now, who isn’t familiar with Harshad Mehta but is he that big a hero or a villain that a common man could be pulled to watch his life story pan out? Well, due credit to the National Award-winning filmmaker Hansal Mehta, to make it so.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 18px; font-stretch: normal; line-height: 1.5em; color: rgb(49, 49, 49); font-family: &quot;Noto Serif&quot;, serif; word-break: break-word;\">A journey that starts from a space-crunched Gujarati household in Mumbai, takes one on a 360-degree roller coaster ride to a 15,000 sq-feet house in Maximum City. They say start from basics. Harshad Mehta duly did that but did rising in ranks teach him enough of the trade?</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 18px; font-stretch: normal; line-height: 1.5em; color: rgb(49, 49, 49); font-family: &quot;Noto Serif&quot;, serif; word-break: break-word;\">This one series on SonyLIV is an investment of time — 10 episodes about 50 minutes each. Pardon the repetition, of a story one knows...but in dextrous hands of Mehta (Hansal), it’s not just a broker’s journey, but story of a man, who was a son, brother, husband and father, and lived each role to its hilt.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 18px; font-stretch: normal; line-height: 1.5em; color: rgb(49, 49, 49); font-family: &quot;Noto Serif&quot;, serif; word-break: break-word;\">The first hour into the film establishes the premise. Sports analogies goad in the basics – jobbers, bull, bear, largely Bombay Stock Exchange and the world around it. One grows fond of the protagonist — the one who establishes himself to be the Amitabh Bachchan of the market, taking pride in his moniker ‘Big Bull’. But like every hero, this one suffers from hamartia too; here it is a phrase – ‘Risk hai to ishq hai’. It’s his ‘daring’ that grows on you episode by episode. The crash of the market, his empire, loss of name, the newsrooms, noise through the corridors of Parliament and the comeback — all pans out among the beautiful shots of Mumbai with glimpses of Delhi weaved in.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 18px; font-stretch: normal; line-height: 1.5em; color: rgb(49, 49, 49); font-family: &quot;Noto Serif&quot;, serif; word-break: break-word;\">It’s the casting that deserves due credit — Pratik Gandhi (titular role), Hemant Kher (Ashwin Mehta), Chirag Vohra (Bhushan Bhatt ) — the triumvirate of this saga; Shreya Dhanwanthary (Sucheta Dalal), Rajat Kapoor (upright CBI officer), Ananth Mahadevan (the RBI Governor) nail their characters. The background score takes this montage to another level. From Ilu Ilu in investigations to a bhajan making it to the credit line, there’s quite a range, but its background score that builds the chase. While the series does get lackadaisical at times, the constant shuffling between the dates and counter moves by the Kapil Dev of share market keep one with the story. Seeing The Common Man R. K. Laxman; the lawyer of the rich and famous Ram Jethmalani and the two Prime Ministers’ flashes pique one’s interest.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 18px; font-stretch: normal; line-height: 1.5em; color: rgb(49, 49, 49); font-family: &quot;Noto Serif&quot;, serif; word-break: break-word;\">Based on journalist Sucheta Dalal and Debashish Basu’s book The Scam: Who Won, Who Lost,Who Got Away rings true even in the contemporary era. Questioning, criticising our economic system, banks’ functioning, role of CBI and how its image changes from that of law-bearer to the one pulling strings in the political corridors — sound familiar. By the end of it, justice may remain an elusive dream, what doesn’t is Hansal Mehta’s treatment. A fascinating journey into life of not just Harshad Mehta but a new world as one walks out with core stock market terms, India’s turn to liberalisation and most significantly leaving one with issues to reflect, and there lies the real strength of Hansal Mehta’s craft!</p>',_binary '','2020-10-18 15:17:51','SonyLiv, StockMarket','Scam 1992 captures the complex yet fascinating journey of Harshad Mehta',32),(10,'published','<p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">op Gear can exclusively reveal that Shelby SuperCars (SSC) North America has set a new top&nbsp;speed record for a production car, hitting a v-max of 331mph and setting a two-way average of 316.11mph on a seven-mile stretch of closed road just outside of Las Vegas,&nbsp;Nevada.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Before you read any further, we recommend you hit play above and climb on board for the outrageous 0-331mph run. Top Gear is being granted this exclusive footage from the guys that are making the full feature-length documentary of this epic endeavour, landing later in the&nbsp;year.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Picked your jaw up off the floor yet? Good. Just when we thought 2020 couldn’t get any more surreal, Team America smashes&nbsp;<a href=\"https://www.topgear.com/car-news/tg-awards-2019/bugatti-has-broken-300mph-barrier\" target=\"_blank\" style=\"color: rgb(0, 105, 113); border-bottom: 1px solid rgb(0, 105, 113);\">Bugatti’s 304.77mph set in that go-faster Chiron at Ehra-Lessien</a>. Better than that, on Saturday 10 October, SSC did it in two directions – something the Chiron failed to do – stealing the crown off Bugatti and once again beating the hypercar glitterati fair and square. Just like it did way back in&nbsp;2007.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">To hit an average speed of 316.11 mph (508.73 km/h), British racing driver Oliver Webb got behind the wheel, pointed the nose at the horizon and pinned it down the two-lane highway. On his first run he hit 301.07 mph (484.53 km/h) – spicy speeds in anyone’s book, but not good enough for an official world&nbsp;record.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">So he turned the car around and did exactly the same in the other direction, this time not letting his foot off the throttle until he hit 331.15 mph (532.93 km/h), good enough for an average of 316.11mph to make the SSC Tuatara the fastest production vehicle on the&nbsp;planet.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">The straight section of State Route 160 between Las Vegas and Pahrump may ring a bell, especially if you’re a speed freak. It’s the same bit of tarmac&nbsp;<a href=\"https://www.topgear.com/car-news/supercars/koenigsegg-agera-rs-has-claimed-five-speed-records\" target=\"_blank\" style=\"color: rgb(0, 105, 113); border-bottom: 1px solid rgb(0, 105, 113);\">made famous by Koenigsegg in 2017, when it claimed the title of world’s fastest production car</a>&nbsp;from SSC’s previous creation, the Ultimate Aero (which hit 255.83mph on a closed road in Washington State in 2007,&nbsp;itself taking the title from the Bugatti&nbsp;Veyron).</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">The Swedish&nbsp;<a href=\"https://www.topgear.com/car-news/supercars/koenigsegg-has-smashed-worlds-fastest-car-record\" target=\"_blank\" style=\"color: rgb(0, 105, 113); border-bottom: 1px solid rgb(0, 105, 113);\">Agera RS posted a two-way average of 277.9mph in Nevada, with a w-max&nbsp;of 284.55mph</a>. SSC has just added nearly 40mph on top of that average. Stop and think about that for a second. Now&nbsp;breathe.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><br></p><blockquote style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\" class=\"blockquote\"><p><span style=\"font-size: 25px; font-weight: 700; text-indent: -12.5px;\">I know we could have gone faster - Oli&nbsp;Webb</span></p></blockquote><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Just what the hell is the SSC Tuatara? Well, it first broke cover in 2011 as the replacement for the Ultimate Aero. Since its inception Top Gear has been following its progress and exclusively&nbsp;<a href=\"https://www.topgear.com/car-news/supercars/could-ssc-tuatara-be-first-car-break-300mph\" target=\"_blank\" style=\"color: rgb(0, 105, 113); border-bottom: 1px solid rgb(0, 105, 113);\">drove the development car last year</a>, and unsurprisingly, we found it to be rather brisk to&nbsp;drive.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Built in Richlands, Washington, USA, the 1,247kg hypercar is powered by a twin-turbocharged 5.9-litre flat-plane crank V8 producing 1,750 horsepower. But power only gets you so far. The Tuatara’s crazy v-max comes in no small part from the outlandish design of its carbon fibre bodywork. That bit is the work of Jason Castriota, he of Maserati Birdcage Concept, Ferrari P4/5, Ford Mach-E and Saab Phoenix fame. From the outset, Castriota stressed the focus on delivering a crazy 0.279 drag coefficient and an aero-centric philosophy. The Tuatara’s slinky ability to pierce through the air effectively is obvious towards the end of the run; the Tuatara furiously blasts from 250-300mph and beyond, not pausing for breath. Now check out Bugatti’s run – where the Chiron is headbutting an aerodynamic&nbsp;wall.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Having completed the run (and Amazon Prime’d a larger pair of undercrackers to house his new, plumper cajones), Brit&nbsp;Oli Webb had this to say: “There was definitely more in there. And with better conditions, I know we could have gone faster, as I approached 331 mph, the Tuatara climbed almost 20mph within the last five seconds. The car wasn’t running out of steam yet. The crosswinds are all that prevented us from realising the car’s&nbsp;limit.”</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Watching this film and processing the numbers it’s hard to imagine it ever being bettered. After all, it was 13 years ago that SSC stunned the automotive nobility when it set the production car speed record by hitting 255, taking the title from Bugatti with the added validation of Guinness. Now, thanks to being a production vehicle, having a two-way average, being on the public road, and having certified GPS data and two world-record sanctioned witnesses on site while running street tyres and non-race fuel, they’ve won again: fair and&nbsp;square.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">“It’s been ten years since we held this record with our first car, the Ultimate Aero, and the Tuatara is leagues ahead. Its performance reflects the dedication and focus with which we pursued this achievement,” said Jerod Shelby, CEO of SSC. “We came pretty close to meeting the theoretical numbers, which is astonishing to do in a real world setting on a public&nbsp;road.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">“America’s new claim to victory in the ‘land-based space race’ is going to be tough to beat,” he&nbsp;added.</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">SSC might well have just put the full stop at the end of the hypercar speed equation, but in a market were fastest is best and egos are big, we’re sure it won’t be taken lying down. We may need a bigger planet. Your move Bugatti, Koenigsegg,&nbsp;Hennessey…</p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><br></p><p style=\"margin: 1em auto; max-width: none; color: rgb(69, 69, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><img src=\"https://www.topgear.com/sites/default/files/lipman_89243.jpg\" style=\"width: 1085.6px;\"><br></p>',_binary '','2020-10-20 06:52:24','Cars, SSC','SSC’s Tuatara is the fastest car in the world with 331mph top speed',30);
INSERT INTO `author_articles` VALUES (11,'published','<h1 style=\"line-height: 1.5; border-width: 0px; border-style: solid;\"><span style=\"background-color: rgb(239, 239, 239);\"><font color=\"#ff0000\">Demon Slayer The Movie : Mugen Train</font></span></h1><h4 style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\"><br></h4><h4 style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">Demon Slayer The Movie : Mugen Train a Japanese action/adventure anime, was the best performing film in the world this weekend.</h4><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">Given an unusual Friday release, on 403 screens, by distributors Aniplex and Toho, the film earned $12 million on its opening day. Over the three-day period it totaled $44 million, from 3.42 million admissions.</p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">This compares with the three-day take of $30 million for “Frozen 2,” which went on to finish with $121 million in&nbsp;<a href=\"https://variety.com/t/japan/\" id=\"auto-tag_japan\" data-tag=\"japan\" style=\"border-top-width: 0px; border-right-width: 0px; border-bottom: none; border-left-width: 0px; border-top-style: solid; border-right-style: solid; border-left-style: solid; color: rgb(0, 102, 204); transition: color 0.15s linear 0s, border-color 0.15s linear 0s;\">Japan</a>&nbsp;in 2019, and the $15.6 million for “Weathering with You,” the Shinkai Makoto anime that made $134 million.</p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">This three-day figure also exceeds the $36 million made by “Confidence Man JP: Princess,” the third-highest earning Japanese film of 2020, in its entire run.</p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\"></p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\"></p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">The score comes despite pandemic safety measures. These include spaced seating that limits admissions to about half of normal capacity.</p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">Produced by Aniplex, Shueisha and Ufotable, the film has been boosted locally by its source material, a Gotoge Koyoharu comic about a boy who turns demon slayer after his family is killed and his sister kidnapped by demons. First appearing in February 2016, the comic currently has nearly 100 million copies circulating in paperback editions and digital formats.</p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">The comic also inspired a TV anime that ran from April to September 2019.&nbsp; Aniplex, which is wholly owned by Sony Music Entertainment Japan, has been distributing this series on the Netflix, Amazon and Hulu platforms.</p><p style=\"border-width: 0px; border-style: solid; font-size: 18px; line-height: 1.5; color: rgb(0, 0, 0); font-family: &quot;IBM Plex Serif&quot;, serif;\">“Demon Slayer” is set for a North American release in early 2021, with Aniplex of America and Funimation distributing. Among overseas territories, however, Taiwan will get the film first, on Oct. 30, with others to follow.</p>',_binary '','2020-10-20 09:27:02','Anime, Demon Slayer','Demon Slayer’ Kills With $44 Million Japan Box Office Weekend',31);
INSERT INTO `author_articles` VALUES (12,'published','<div><font face=\"Comic Sans MS\">According to the above post, Cyberpunk 2077 has been further delayed by three weeks, with the new release date announced to be 10th December, 2020. As the game is scheduled to be released on a host of platforms including current generation and next generation consoles, along with PCs, there are a total of 9 versions that need to be tested.</font></div><div><font face=\"Comic Sans MS\"><br></font></div><div><font face=\"Comic Sans MS\">According to the developers, they had under-calculated the period in which last-minute improvements were to be made, which has resulted in the latest delay. The statement also said that it is their determination to get the best version of Cyberpunk 2077 out to gamers, that have led to this delay.</font></div><div><font face=\"Comic Sans MS\"><br></font></div><div><font face=\"Comic Sans MS\">Of course, this does not mean that gamers across the world did not rush to Twitter to let their convey their disappointment at the news. As you can see below, quite a few fans referenced a recent post which ‘guaranteed’ that the game will be released on the 19th of November.</font></div><div><font face=\"Comic Sans MS\"><br></font></div><div><font face=\"Comic Sans MS\"><br></font></div><div><font face=\"Comic Sans MS\">Following the confirmation, many fans had ended up taking days off their work to enjoy playing the game from the first day itself. As you can see below, there were multiple fans who lamented that their places of employment will not allow further shifting of the holidays.<br></font></div>',_binary '','2020-10-29 16:29:13','Game, CyberPunk 2077','\'CyberPunk 2077\' 3-week delay angers thousands online, Twitter takes sly jabs at developers',30);
INSERT INTO `author_articles` VALUES (14,'published','<header class=\"post-header\" style=\"margin: 0px 0px 1.25rem; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0);\"><p class=\"meta post-meta\" style=\"margin: 0.625rem 0px 0px; padding: 0.3125rem; border-width: 1px 0px; border-top-style: solid; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: rgb(235, 235, 235); border-right-color: initial; border-bottom-color: rgb(235, 235, 235); border-left-color: initial; border-image: initial; font-style: italic; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 0.8125rem; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(170, 170, 170);\"><br></p></header><div class=\"entry clearfix\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0);\"><div class=\"post-thumbnail\" style=\"margin: 0px 0px 1.25rem; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; max-width: 940px;\"><a href=\"https://i0.wp.com/wallofsoundau.com/wp-content/uploads/2020/10/architects-2020.jpg?fit=1200%2C812&amp;ssl=1\" rel=\"prettyPhoto\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(230, 73, 70);\"></a></div><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">The news you’ve been waiting for is here!&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Architects</strong>&nbsp;have confirmed their ninth studio album will be called&nbsp;<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">For Those That Wish To Exist</strong></em>, and it is set for release on&nbsp;<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">February 26</em>&nbsp;via&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Epitaph</strong>&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Records</strong>. According to the band, the album’s themes will focus on:</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: center;\"><em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">“…the part we are all playing in the world’s slow destruction, and tackle the biggest questions facing the future of our planet”.</em></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Dan Searle</strong>, drummer and principal songwriter for&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Architects</strong>&nbsp;shared his thoughts on the angle he went into writing&nbsp;<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">For Those That Wish To Exist</strong></em>‘s tracks, revealing:</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: center;\"><em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">“This album was me looking at our inability to change to a way of life that would sustain the human race and save the planet…&nbsp;</em><em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">I wanted to look in the mirror and ask ourselves the question of what are &lt;we&gt; going to do, as opposed to trying to point the finger at politicians. Change has to start on a personal level. The world has developed a culture of wanting someone else to deal with it, when we need to take our own responsibility. It has to start there.”</em></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">If that’s not enough to get you excited, there are 15 new songs incoming (including their&nbsp;<a href=\"https://wallofsoundau.com/2020/10/20/wtf-a-new-architects-song-has-landed/\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(230, 73, 70);\">stellar new single</a>&nbsp;‘<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Animals</strong>‘), some of which also features cameos from&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Parkway Drive</strong>‘s&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Winston</strong>&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">McCall</strong>,&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Mike</strong>&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Kerr</strong>&nbsp;of&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Royal</strong>&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Blood</strong>&nbsp;and&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Simon</strong>&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Neil</strong>&nbsp;from&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Biffy</strong>&nbsp;<strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Clyro</strong>. HOLY FUCK!!!</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">Their last album&nbsp;<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Holy Hell</strong></em>&nbsp;debuted at #2 on the ARIA Charts, let’s get this new bad boy all the way to #1. I know we can do it too. For the variant collectors, there’s also a limited edition&nbsp;<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Australian Exclusive Clear Blue Red Splatter</em>&nbsp;vinyl up for sale too, so get yours ASAP!</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><img src=\"https://i2.wp.com/wallofsoundau.com/wp-content/uploads/2020/10/architects-album.jpg?resize=768%2C768&amp;ssl=1\" style=\"width: 768px;\"></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; text-align: center;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Architects</strong>&nbsp;–&nbsp;<em style=\"margin: 0px; padding: 0px; border: 0px; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: bold; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">For Those That Wish To Exist&nbsp;</strong>tracklisting</em></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\"></p></p><p style=\"margin: 0px 0px 1.25rem; padding: 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 400; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; text-align: center;\">1. Do You Dream of Armageddon?<br>2. Black Lungs<br>3. Giving Blood<br>4. Discourse Is Dead<br>5. Dead Butterflies<br>6. An Ordinary Extinction<br>7. Impermanence ft. Winston McCall (Parkway Drive)<br>8. Flight Without Feathers<br>9. Little Wonder ft. Mike Kerr (Royal Blood)<br>10. Animals<br>11. Libertine<br>12. Goliath ft. Simon Neil (Biffy Clyro)<br>13. Demi God<br>14. Meteor<br>15. Dying Is Absolutely Safe</p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><br></p></div>',_binary '','2020-11-03 12:17:26','MetalCore, Architects','Architects Announce New Album ‘For Those That Wish To Exist’',32),(15,'published','<p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Even though 2020 has been truly unpredictable and weird for al of us,&nbsp;<a href=\"https://www.altpress.com/tag/ghost/\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\"><strong style=\"font-weight: bold;\">Ghost</strong>&nbsp;</a>fans have something to look forward to.</p><div class=\"altpr-tonefuse\" id=\"altpr-1813606707\" style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px; margin-top: 25px; margin-bottom: 25px;\"><div id=\"cf_async_840756504\"></div></div><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\"><a href=\"https://www.altpress.com/tag/tobias-forge\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\"><strong style=\"font-weight: bold;\">Tobias Forge</strong></a>&nbsp;confirmed that Ghost’s next album is arriving sooner than you think. As well, fans shouldn’t expect the next record to be influenced by the ongoing world events.</p><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">ack in March 2019, Forge shared a&nbsp;<a href=\"https://www.altpress.com/news/ghost-cardinal-copia-two-album-cycles/\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\">few secrets</a>&nbsp;about Ghost’s plans for a follow up to 2018’s&nbsp;<a href=\"https://www.altpress.com/tag/prequelle\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\"><strong style=\"font-weight: bold;\"><em>Prequelle</em></strong></a>. At first, he teased that they could be doing something they’ve never done before by bringing&nbsp;<a href=\"https://www.altpress.com/tag/cardinal-copia\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\"><strong style=\"font-weight: bold;\">Cardinal Copia</strong></a>&nbsp;back for another album.</p><div class=\"altpr-cedato\" id=\"altpr-761455539\" style=\"color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px; margin-left: auto; margin-right: auto; text-align: center; margin-bottom: 30px;\"><div></div></div><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">“I have a vague idea of what’s in store,” he said. “It’s gonna change over the years, to whatever extent we’ll be around. Right now, if everything goes according to plan, we’re hoping for Cardi to be strong enough and cool enough to possibly do something that none of the previous ones have done, and that’s basically to do two cycles.”</p><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Despite the plans, Forge told fans to not expect the new album anytime soon. The reason? Well, Ghost had a lot of touring to do in 2019. As well, Forge also said he&nbsp;<a href=\"https://www.revolvermag.com/music/ghosts-tobias-forge-says-next-album-coming-after-2020-us-presidential-election\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\">didn’t want to release an album</a>&nbsp;until after the U.S. presidential election.</p><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Then, Ghost entered the studio at the beginning of 2020 to begin recording their next album. It wasn’t until March, however, that fans realized Ghost’s plans for their next album had changed.</p><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">The Swedish band played their only show of 2020 in Mexico City. The performance also marked the end of the&nbsp;<a href=\"https://open.spotify.com/album/1KMfjy6MmPorahRjxhTnxm?si=Z7X2itOtTiS-TjE_rlBQBg\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\"><em>Prequelle</em></a>&nbsp;album cycle. However, it&nbsp;<a href=\"https://consequenceofsound.net/2020/03/ghost-papa-emeritus-iv/?utm_expid=.I2OkZS06Riahk3U0vrA5rQ.0&amp;utm_referrer=\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\">was confirmed</a>&nbsp;that Forge’s persona Cardinal Copia isn’t returning for the next album. During the performance, Cardinal Copia was anointed as&nbsp;<strong style=\"font-weight: bold;\">Papa Emeritus IV</strong>, marking a new era in Ghost’s career.</p><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Following the show, Ghost’s plans continued to change due to the&nbsp;<a href=\"https://www.altpress.com/tag/coronavirus\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\"><strong style=\"font-weight: bold;\">coronavirus</strong></a>&nbsp;pandemic. Along with many other artists, Ghost postponed their tour dates from March 2021 to next autumn. This delay caused fans to believe that new music wouldn’t be arriving until late next year.</p><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Now, Forge has confirmed that Ghost plan to put out their next album “this winter.” Given the ongoing world events, many fans thought the current pandemic would be prime inspiration for the new album.</p><p style=\"margin-bottom: 26px; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">Forge tells Sweden’s&nbsp;<a href=\"https://www.vk.se/2020-10-07/tobias-forge-folk-vill-se-en-show\" target=\"_blank\" rel=\"noopener noreferrer\" style=\"color: rgb(66, 159, 216);\"><em>VK</em></a>, however, that fans shouldn’t expect the new release to be anything about the ongoing pandemic. This is mostly because Forge didn’t actually write any of the new songs during the global pandemic. As well, Ghost already have a record about doomsday.</p>',_binary '','2020-11-03 12:30:53','Ghost','GHOST’S NEXT ALBUM IS ARRIVING SOON BUT DON’T EXPECT ANY PANDEMIC CONTENT',30),(16,'published','<p style=\"margin-bottom: 26px; font-family: &quot;Merriweather Sans&quot;; overflow-wrap: break-word; color: rgb(34, 34, 34); font-size: 15px;\">The Anime which is adored by everybody and the most-watched anime in this type is back with season 4. We should discover more about Attack on Titan Season 4.</p><p style=\"margin-bottom: 26px; font-family: &quot;Merriweather Sans&quot;; overflow-wrap: break-word; color: rgb(34, 34, 34); font-size: 15px;\">We as a whole can concur that the activity and the visuals of Attack on Titan are the best, and the storyline is convincing. This season will be additionally 